import React from "react";

import * as css from "../../utils/cssVariables";

const RequestCommunityPage: React.FC = () => {
  return (
    <React.Fragment>
      <form className="request-community-form">
        <input
          type="text"
          id="name"
          placeholder="Name of Community: "
          required
        />
        <input
          type="text"
          id="link"
          placeholder="Link to documentation: "
          required
        />
      </form>

      <style jsx>{`
        .request-community-form {
          height: 200px;
          width: 40%;
          border: 1px solid red;
          margin: 200px auto;
          display: flex;
          flex-direction: column;
          justify-content: center;
        }

        input {
          width: 100%;
          height: 40px;
          margin: 30px 0;
          text-indent: 15px;
          background: ${css.inputBackground};
          color: #ffffff;
          border: 2px solid ${css.inputBorder};
          font-size: 0.8rem;
        }
      `}</style>
    </React.Fragment>
  );
};

export default RequestCommunityPage;
